import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import { Col, Row } from "react-bootstrap";

const Detailblog = () => {
  return (
    <>
      <Header />
      <Row>
        <Col className="col-9"></Col>
        <Col className="col-3"></Col>
      </Row>
      <Footer />
    </>
  );
};

export default Detailblog;
